function add_menu_hover_class() {
  $("#menu li a").hover(
    function() { $(this).parent().addClass("hover") },
    function() { $(this).parent().removeClass("hover") }
  );
};
$(add_menu_hover_class);

Cufon.replace("#sidebar h2", {hover: true});
Cufon.replace("#next_action h2 a", {hover: true});
Cufon.replace("#highlights h2");
Cufon.replace("#feeds h2", {hover: true});
Cufon.replace("#content h2.caps, #content h3.caps", {hover: true});

function action_rollovers() {
  $("#actions .item .info, #past_action .info").css("display", "none");
  $("#actions .item, #past_action").hover(
    function() {
      $(this).addClass("hover");
      $(".info", this).slideDown("fast")
    },
    function() {
      $(this).removeClass("hover");
      $(".info", this).slideUp("fast");
    }
  );
};
$(action_rollovers);

function search_ui() {
  $("#search_box").focus(function() { $(this).val("") });
};
$(search_ui);

function background_illustrations() {
  $("body").prepend('<div id="bgillustration1"></div>' +
                    '<div id="bgillustration2"></div>' +
                    '<div id="bgillustration3"></div>');
  
  function reset() {
    var width = $(window).width() / 2;
    var height = $(document).height();
    $("#bgillustration1, #bgillustration2").css({height: height, width: width});
    
    if (height > 1500) {
      // Document is big enough to display footer illustration
      $("#bgillustration3").css({
        display: "block",
        width: width,
        top: height - 700
      });
    };
  };
  $(window).resize(reset);
  reset();
};
$(background_illustrations);
